    // Load data from url
    if ( dock_el.hasDataAttr('url') && 'true' !== dock_el.data('url-has-loaded') ) {
      dock._loader( dock_el );
    }
    else if ( body_el.hasDataAttr('url') && 'true' !== body_el.data('url-has-loaded') ) {
      dock._loader( body_el );
    }

